import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply Price Sort Filter
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Electronics'); // Fill the search input
    await page.click('.search-btn'); // Click the search button
    await page.waitForSelector('.products-grid', { timeout: 5000 }); // Wait for products to load

    // Sort by price (assuming there's a dropdown for sorting)
    await page.waitForSelector('.sort-controls select', { timeout: 5000 });
    await page.selectOption('.sort-controls select', 'price-low'); // Select price low to high

    // Take screenshot after sorting
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_sorted.png'));

    return {
      success: true,
      action: "Applied price sort filter and took screenshots",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
